params.template:
!js
if (task_configuration.configuration.load_script) {
  const scriptUrl = evaluate_template(task_configuration.configuration.script_source_url, data_source)
  load_script(scriptUrl)
} else {
  task_configuration.configuration.program
}

before_completed.context_key:
!js
const storeResult = task_configuration.configuration.store_result;
const key = task_configuration.configuration.context_key;
storeResult && key && key.length ? key : null;
